//https://leetcode.com/problems/maximal-square
class Solution {
public:
    int maximalSquare(vector<vector<char>>& matrix) {
        int row = matrix.size();
        int col = matrix[0].size();
        if(row == 1 && col == 1){
            return matrix[0][0] == '1'? 1: 0;
        }
        vector<vector<int>> dp(row, vector<int>(col, 0));
        int max_val = 0;
        for(int r=0; r<row; r++){
            if(matrix[r][0] == '1'){
                dp[r][0] = 1;
                max_val = max(max_val, dp[r][0]);
            }
        }
        for(int c=0; c<col; c++){
            if(matrix[0][c] == '1'){
                dp[0][c] = 1;
                max_val = max(max_val, dp[0][c]);
            }
        }
        for(int r=1; r<row; r++){
            for(int c=1; c<col; c++){
                if(matrix[r][c] == '1'){
                    dp[r][c] = 1 + min(min(dp[r-1][c], dp[r][c-1]), dp[r-1][c-1]);
                    max_val = max(max_val, dp[r][c]);
                }
            }
        }
        return max_val*max_val;
    }
};

